    function(layer){

    let handleObject = feature=>typeof(feature)=='object' ? JSON.stringify(feature) : feature;
    let fields = ["Name", "Loc Id", "ARP Latitude", "ARP Longitude", "City", "State Name", "Latitude", "Longitude"];
    let aliases = ["Name", "Loc Id", "ARP Latitude", "ARP Longitude", "City", "State Name", "Latitude", "Longitude"];

        fields.map(
        (v,i)=>

        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
